import React from 'react';

export default function ModalOrders(props) {

    const orders = props.customer.orders;
    console.log(orders[1])

    const ordersData = orders.map((d) =>
        <div>
            <p key={d.id}>{d.hazmana} || {d.amount} || {d.date}</p>);
        </div>
    )

    return (
        <div>
            <h5>Toutes les commandes</h5>
            {ordersData}
        </div>
    )
}
